La Terre d’Israël (en hébreu : ארץ ישראל, Eretz Yisrael) est une étendue géographique comprenant les anciens royaumes d’Israël et de Juda, berceau du peuple juif. Dans la Bible, « Terre d'Israël » désigne : 
* un terme religieux, car renvoyant à un don divin ; il est utilisé pour la première fois dans Samuel 1 13:19 ; 
* un terme géographique. La définition géographique donnée par la Bible est d’ailleurs floue : dans certains textes bibliques, on parle de la Terre donnée comme allant du « fleuve d’Égypte jusqu’au grand fleuve, au fleuve d’Euphrate » (de l’Égypte à l’actuel Irak), d’autres se limitent à une zone comprise entre la mer et le fleuve Jourdain, correspondant peu ou prou à la région appelée Palestine ; 
* un terme politique : c’est la terre donnée aux Juifs pour s’y installer, puis à partir du roi Saül pour s’y construire un État. Ce terme a été utilisé tant par les juifs que les chrétiens au cours de l’histoire (pour l’étymologie de ce nom, voir Israël (Bible)). Cette Eretz Israel est également appelée Terre promise par les Juifs en référence à la première promesse qu’a faite Dieu à Abraham, Isaac et Jacob de donner ce pays à eux et en héritage à leur descendance dans la Genèse : « Et je t'ai donné à toi et à ta postérité la terre de tes pérégrinations, toute la terre de Canaan. » Le nom de Terre sainte est utilisé par les chrétiens en référence à la vie de Jésus. À la suite de plusieurs exils, la nation juive est dispersée à travers le monde antique et plus tard à travers le monde. Un lien spirituel fort invoqué dans la Déclaration d’indépendance de l’État d’Israël la rattache néanmoins à cette terre.
